import "./App.css";
import Landing from "./components/Landing";
import Footer from "./components/Footer";
import Navbar from "./components/Navbar";
import Product from "./components/Product";

function App() {
  return (
    <>
      <Navbar />
      <Landing />
      <Footer />
      <Product />
    </>
  );
}

export default App;
